import React from "react";
import style from "./About.module.css";

const About = () => {
  return (
    <div className={style.aboutContainer}>
      <div className={style.contentContainer}>
        <div className={style.description}>
          <h1>ABOUT ME.</h1>
          <p>
            Soy un Desarrollador Web FullStack que vive en Paso de los Libres,
            Corrientes, Argentina.
          </p>
          <pre>
            He comenzado mi carrera en 2023, estudiando como autodidacta. Luego
            decidi meterme en Soy Henry para conseguir
            <pre>un aprendizaje mas conciso.</pre>
            <pre>
              Estoy dispuesto a solucionar errores de todo tipo, y abierto a
              seguir aprendiendo para poder despegar mi
            </pre>
            <pre>carrera tech!</pre>
          </pre>
          <hr></hr>
        </div>
      </div>
    </div>
  );
};

export default About;
